goog.provide('goog.unilang.symbol');
goog.require('goog.graphics.SvgGraphics');
goog.require('goog.graphics.SvgPathElement');
goog.require('goog.ui.Tooltip');

//constructor
goog.unilang.symbol = function (value, optRootDomElement, args){
	//set constants, default or from args
	var args = args || {};
	this.width  = args.width || 100;
	this.height = args.height || 100;
	this.margin = args.margin || 25;
	this.stroke = args.stroke || "black";
	this.strokeWidth = args.strokeWidth || 1;
	this.aidingPointDiam = args.aidingPointDiam || this.strokeWidth * 1.8;
	this.fill = args.fill || "white"; //"none"
	this.currentSymbolDictName = args.symbolDictName || "noCrossingsAllowed";
	this.segmentType = args.segmentType || "basic";
	
	this.randomPattern = args.randomPattern || "xxxx";
	this.numberOfQuadrants  = args.numberOfQuadrants || 4;
	//console.log(this.numberOfQuadrants + 100);
	
	if (args.displayAidingPoints == undefined) {
		
		this.displayAidingPoints = true; //should aiding points be displayed on the symbol?
	}else{
		this.displayAidingPoints = args.displayAidingPoints;
	}
	
	//set other constants
	this.quadrantWidth = this.width / 2;
	this.quadrantHeight = this.height / 2;
	
	
	//get quandrant symbol set.
	this.quadrantSymbols = this.quadrantSymbolsDicts[this.currentSymbolDictName];
	this.symbolDictNameForNextValue = this.currentSymbolDictName;
	
	//console.log("number of quadrant symbols: " + getKeys(this.quadrantSymbols).length);
	//CHECK SYMBOLS-----------------
	this.initSymbols();
	//END CHECK SYMBOLS-----------------
	
	//symbol id
	if (value != undefined){
		this.value = value;
	} else {
		this.randomValueFromPattern();
	}

	//initialise symbol parameters
	this.path = new goog.graphics.Path(); //the symbolpath
	
	this.aidingPointsToShow= []; //aiding points that should be showed (depending on bows in symbol //DEBUG: not yet implemented to discard aiding points where a line is running over...
	this.svgElementsCreated = [];
	
	// sequence! first dimensioning of points, then choosing of types
	this.initDimensions();
	this.quadrantPoints = this.quadrantPointTypes[this.segmentType];
	//set segment type
	this.segments = this.segmentTypes[this.segmentType];
	
	//console.log(this.segments);
	
	//set drawing attributes (width, colour,...)
	this.decorate();
	
	//create svg in dom
	//draw symbol if root element of the dom is defined.
	//console.log(optRootDomElement);
	
	this.rootDomElementId = optRootDomElement;
	
	if (this.rootDomElementId != undefined){
		this.updateDisplaySymbol();
		/*
		// DONT do this, an instance of symbol can be added to lot's of dom elements, so it changes... this.rootDomElement = optRootDomElement;
		this.addToDom(optRootDomElement);
		//display symbol
		this.symbolToGraphics();
		//set listeners for events
		goog.events.listen(this.graphics.getElement(), goog.events.EventType.CLICK, this.symbolClicked, false, this);
		//goog.events.listen(this.graphics.getElement(), goog.events.EventType.MOUSEOVER, this.changeColour, false, this);
		//goog.events.listen(this.graphics.getElement(), goog.events.EventType.MOUSEOVER, this.symbolClicked, false, this);
		//goog.events.listen(this.graphics.getElement(), goog.events.EventType.DBLCLICK, this.changeColour, false, this);
		*/
	}
	
}

