goog.unilang.symbol.prototype.initSymbols = function (){
	//makes sure we got an associative array from the symbols
		//--> if it needs to be converted from a list: makes all alphabetic combinations(=name) of a certain length lead to a valid symbol. 

	//if not associative array, not yet values assigned to each symbol...
	//assign random value to symbol
	if(this.quadrantSymbols instanceof Array){
		var quadrantSymbolsAss = {};
		var numberOfSymbols = this.quadrantSymbols.length;
		
		var alphabeth = "abcdefghijklmnopqrstuvwxyz";
		if (this.quadrantSymbols.length <=26){
			for (var i = 0; i< alphabeth.length;i++){
				//quadrantSymbolsAss[alphabeth.slice(i,i+1)]= this.quadrantSymbols[ i - (Math.floor(numberOfSymbols / i) * numberOfSymbols )];
				var path = this.quadrantSymbols[i- (Math.floor(i/numberOfSymbols) * numberOfSymbols )];
				
				quadrantSymbolsAss[alphabeth.slice(i,i+1)] = path;
			}
		}else if (this.quadrantSymbols.length <=676){
			
			for (var i = 0; i< alphabeth.length;i++){
				for (var j = 0; j< alphabeth.length;j++){
					var path = this.quadrantSymbols[((i*alphabeth.length)+j)- (Math.floor( ((i*alphabeth.length)+j)/numberOfSymbols) * numberOfSymbols )];
					var key = alphabeth.slice(i,i+1) + alphabeth.slice(j,j+1);
					quadrantSymbolsAss[key]= this.quadrantSymbols[((i*alphabeth.length)+j)- (Math.floor( ((i*alphabeth.length)+j)/numberOfSymbols) * numberOfSymbols )];
				}
			}
		}
		else{
		
		
		
		
		
		
		
			console.log("number of symbols: " +  numberOfSymbols);
			console.log("error, please create symbol names for more than 676 characters... ");
		}
		this.quadrantSymbols = quadrantSymbolsAss;
		
	}
	
	//check for symbol name length
	this.symbolNameLenght = undefined;
	for (k in this.quadrantSymbols){
		if (this.symbolNameLenght == undefined){
			this.symbolNameLenght = k.length;
		}
		if (k.length != this.symbolNameLenght){
			console.log("ERROR, not all symbolNames are of equal length..." + k);
		}
	}
}

