goog.unilang.symbol.prototype.randomValueFromPattern = function (code){
	//code = sequence of four characters (one for each quadrant) even when using less than four quadrants, still provide four characters length .
	//build up of code:
	//x= random, 1-4 = equal as in quadrant defined by number.
	// i.e. xxxx = 4 quadrants random
	// i.e. x1x3 = q1 = random, Q2 = Q1 , Q3 = random, Q4 = Q3
	
	
	if (this.symbolDictNameForNextValue != this.currentSymbolDictName){
		//console.log("changed symbolDict");
		this.quadrantSymbols = this.quadrantSymbolsDicts[this.symbolDictNameForNextValue];
		this.currentSymbolDictName = this.symbolDictNameForNextValue;
		this.initSymbols();
	}
	if (code == undefined){
		if (this.randomPattern == undefined){
			for (var i=0; i<this.numberOfQuadrants; i++){
				this.randomPattern += "x";
			}
	}
		code = this.randomPattern;
	}else{
		this.randomPattern = code;
	}
	//x= random, 1-4 = equal as in quadrant defined by number.
	// i.e. xxxx = 4 quadrants random
	// i.e. x1x3 = q1 = random, Q2 = Q1 , Q3 = random, Q4 = Q3
	
	//var loop = code.length;
	
	this.value = "";
	var quadrantValues = new Array(this.numberOfQuadrants);
	for (var i = 0; i< quadrantValues.length; i++){
		if (code.slice(i,i+1) == "x"){
			quadrantValues[i] = getRandomKey(this.quadrantSymbols);
		}else{
			quadrantValues[i] = quadrantValues[ parseInt(code.slice(i,i+1))-1];
			
		}
		this.value += quadrantValues[i];
	}
	//console.log(this.value);
	}

