	//affects all instances of symbol. do a refresh afterwards to affect changes.

	this.fill = optFill || this.fill;
	this.stroke = optStroke || this.stroke;
	this.strokeWidth = optStrokeWidth || this.strokeWidth;

	goog.unilang.symbol.prototype.fillObj = new goog.graphics.SolidFill(this.fill);
	goog.unilang.symbol.prototype.strokeObj = new goog.graphics.Stroke(this.strokeWidth, this.stroke);

	//draw all again.
